import React from 'react';
import "./styles.scss";

export class DateInput extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            start: "1979-09-19",
            end: "2019-09-19",
        }
        this.props.callBack(this.state.start, this.state.end);
    }

    startChange = (e) => {
        this.setState({
            start: e.target.value
        });
        this.props.callBack(e.target.value, this.state.end);
        console.log(e.target.value);
    }
    endChange = (e) => {
        this.setState({
            end: e.target.value
        });
        this.props.callBack(this.state.start, e.target.value);
        console.log(e.target.value);
    }
    render = () => {

        return (
            <form className="dateInput">
                <label htmlFor="startDate" className="dateLabel">Start Date:</label>
                <input type="date" id="startDate"
                    value={this.state.start} 
                    onChange={this.startChange} 
                    max = {this.state.end}
                />
                <label htmlFor="endDate" className="dateLabel">End Date:</label>
                <input type="date" id="endDate" 
                    value={this.state.end}
                    onChange={this.endChange}
                    min = {this.state.start}
                />
            </form>
        );
    }
}
